questions.description:
Вкажіть від яких саме ризиків треба застрахувати майно: 
 - вогневі ризики;
 - вогневі ризики, стихійні явища;
 - вогневі ризики, стихійні явища, дія води;
 - вогневі ризики, стихійні явища, дія води, протиправні дії третіх осіб;
 - вогневі ризики, стихійні явища, дія води, протиправні дії третіх осіб, транспортні ризики.
